import React from 'react'

const Crews = (props) => {
  return (
    <div style={{ marginTop: "90px" }} className = "card">
        <h3 className="title bg-dark  text-light">{props.name}</h3>
        <img src={props.image} className="rounded mx-auto d-block " alt="..." style={{ width: "400px", height: "400px"}} />

    </div>
  )
}

export default Crews
